import React from 'react';
import "../css/PropiedadHome.css";
import { BrowserRouter as Router, Link } from "react-router-dom";


function PropiedadHome(props) {
  return (
    <Link to={"/Details/"+ props.id} state={{ props }}>
    <div className={props.alquilada ? 'contenedor-propiedad-home alquilada' : 'contenedor-propiedad-home'}>
      <img 
        className='imagen-propiedad'
        src={require(`../images/${props.imagen}.png`)}
        alt={"Imagen de Propiedad " + props.nombre}/>
      <div className='contenedor-texto-propiedad'>
        <h2 className='nombre-propiedad'>
          <strong>{props.nombre}</strong> en {props.direccion}
        </h2>
        <div className='row'>
          <h1 className='precio-propiedad'>
             <strong>{props.precio} </strong>
          </h1>
          <h2>
          + {props.expensas} expensas
          </h2>
          <p className='operacion-propiedad'>{props.operacion}</p>
        </div>
        <div className='row'>
          <p><strong>{props.ambientes}</strong> ambientes</p>
          <p><strong>{props.metros}</strong> m2 cubiertos</p>
        </div>
      </div>
    </div>
    </Link>
  );
}

export default PropiedadHome;
